commit_message:
Add external ceph related attributes to openstack.yaml

Added external_ceph checkbox;
ceph monitor url text input;
ceph access key textarea;

External ceph enabled when volumes_ceph or
images_ceph or ephemeral_ceph enabled

Change-Id: Ic1eda40d94a7c07a9ffe6d7337ccbe3c005ea5a9
